import img1 from "../Images/axis-M2025.jpg";
import img2 from "../Images/axis-p1428.jpg";
import img3 from "../Images/axis-Q6000.jpg";

export default function home () {
  
  return (
 
<Container fluid>
  <Row>
    <Col><h1>Welcome to your device management system homepage</h1></Col>
  </Row>
  <Row>
    <Col><h3>Get full control </h3></Col>
  </Row>
</Container>

  )}
